import React from 'react'
import {View, Text, TouchableWithoutFeedback, ImageBackground, StyleSheet} from 'react-native'

export const CategoryItem = ({title, image, length, totalLength}) => {

    console.log('IMAGE', image, totalLength)
    return(
        <TouchableWithoutFeedback style={{width: '100%', height: '50%'}}>
            <View>
            <ImageBackground source={image} style={styles.image}>
                <View>
                    <Text>{length}</Text>
                    <Text>{title}</Text>
                </View>
            </ImageBackground>
            </View>
        </TouchableWithoutFeedback>
    )
}

const styles = StyleSheet.create({
    image: {
        flex: 1,
        width: '100%',
        height: '100%'
    }
})
